import React from "react";

const Navbar = () => {

    return (
        <nav class="navbar navbar-dark bg-secondary px-2">
        <a class="navbar-brand" href="https://redux.js.org" target="_blank" rel="noreferrer">Redux</a>

        <button class="navbar-toggler" data-bs-toggle="collapse" data-bs-target="#hidden-menu">
              <span class="navbar-toggler-icon"></span>
        </button>

        <div class="offcanvas offcanvas-start"  id="hidden-menu">
            <a class="btn-close d-md-none" href="" data-bs-dismiss="offcanvas"></a>
            <div class="offcanvas-body flex-md-row align-items-center">
                <ul class="navbar-nav">
                    <li><a class="nav-link" href="">Shop</a></li>
                    <li><a class="nav-link" href="">Users</a></li>
                </ul>
              </div>
       </div>
</nav>
    );
}

export default Navbar;
